import {makeAutoObservable} from "mobx"

class OneUser {
    constructor(id,fn){
        this._id =  id;
        this._fn = fn
    }
};



export default class UsersConteiner{
    constructor(){
        this._users = [
           new OneUser(1, "adf"),
           new OneUser(2, "adfs")
        ]
        makeAutoObservable(this)
    }


    setUsers(users){
        this._users = users
    }

    get users(){
        return this._users
    }

    

}
